import React from "react";
import Mobile from "./Mobile";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  main: {
    color: "red",
    width: ""
  },
}));

function Index() {
  const classes = useStyles();
  return (
    <div >
      <Mobile className={classes.main}/>
    </div>
  );
}

export default Index;
